        const {currentClient} = this.state;
        const currentName = this.props.test2d[this.props.clientnum][0];
        const currentAddress = this.props.test2d[this.props.clientnum][1];
        const currentCity = this.props.test2d[this.props.clientnum][2];
        const currentTelephone = this.props.test2d[this.props.clientnum][3];
        const currentEmail = this.props.test2d[this.props.clientnum][4];
